// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "./SafeBEP20.sol";

contract StakingPlatform is Ownable {

    using SafeMath for uint256;
    using SafeBEP20 for IBEP20;

    // args for _stakers
    struct Staker {
        uint256 stakerCurrentReward;
        uint256 stakedAmount;
        uint256 mode;
        uint256 stakeStartTime;
        uint256 lastUpdatedTime;
    }   
    
    // refer to CRSFANS token. Address: 0x7AD8A62451f79399c940fC1A6FE96358a80B1931
    
    uint256 private _unstakingFeeRate;
    uint256 private _eventPeriod;
    uint256 private _fixedAPY;
    uint256 private _rewardFeeRate;
    address private _bountyWallet;

    mapping(address => Staker) private _staker;

    // Total amount of token staked in staking pool.
    uint256 public totalStaked;
    IBEP20 public token;
    
    // Events triggered when start, stake, unstake(withdraw), get reward.
    event Staked(address staker, uint256 amount);
    event Harvest(address staker, uint256 rewardToClaim);
    event Withdraw(address staker, uint256 amount);
    event SetFixedAPY(uint256 fixedAPY);
    event SetEventPeriod(uint256 lockupDuration);
    event SetUnstakingFeeRate(uint256 unstakingFeeRate);
    event SetBountyWallet(address bountyWallet);

    constructor(address _token, address __bountyWallet) {
        
        Init();
        _bountyWallet = __bountyWallet;
        token = IBEP20(_token);
    }

    function Init() internal {

        _fixedAPY = 125;
        _unstakingFeeRate = 1500;
        _rewardFeeRate = 200;
        _eventPeriod = 7 days;
    }

    function calDaysFromTimestamp(uint256 timedur) internal pure returns (uint256) {
        
        return timedur.div(1 days);
    }

    // Update rewards for _stakers according to deposited amount.
    function updateReward() private{
        
        Staker storage staker = _staker[msg.sender];
        if(block.timestamp < staker.lastUpdatedTime) {
            return;
        }        
        uint256 duration = calDaysFromTimestamp(block.timestamp - staker.stakeStartTime);
        uint256 newReward = staker.stakedAmount.mul(duration).mul(_fixedAPY).div(1e4);
        if (staker.mode == 1) {
            uint256 eventCount = duration.div(_eventPeriod);
            newReward = staker.stakedAmount.mul(eventCount).mul(_fixedAPY.mul(calDaysFromTimestamp(_eventPeriod))).div(1e4);
        }
        staker.stakerCurrentReward = staker.stakerCurrentReward.add(newReward);
        staker.lastUpdatedTime = block.timestamp;
    }

    function startStaking(uint256 _amount, uint256 _mode) external {

        require(_amount > 0, "Amount should be greater than 0");
        require(token.balanceOf(msg.sender) > _amount, "Insufficient!");
        require(_staker[msg.sender].stakeStartTime != 0, "Already started");

        _staker[msg.sender].mode = _mode;
        _staker[msg.sender].stakeStartTime = block.timestamp;
        stake(_amount);
    }

    // Staker tries to stake specific amount of token.
    function stake(uint256 _amount) public{
        
        require(_amount > 0, "Amount should be greater than 0");
        require(token.balanceOf(msg.sender) > _amount, "Insufficient!");
        
        updateReward();
        Staker storage staker = _staker[msg.sender];
        token.safeTransferFrom(msg.sender, address(this), _amount);
        staker.stakedAmount = staker.stakedAmount.add(_amount);
        totalStaked = totalStaked.add(_amount);
        
        emit Staked(msg.sender, _amount);
    }

    // Withdraw some of token staked.
    function withdraw(uint256 amount) external{
        
        Staker storage staker = _staker[msg.sender];

        require(amount > 0, "Amount should be greater than 0");
        require(amount <= staker.stakedAmount, "Invalid amount");

        updateReward();
        uint256 amountTobeWithdrawn = amount < token.balanceOf(address(this)) ? amount : token.balanceOf(address(this));
        uint256 isLockupTimeOver = block.timestamp.sub(staker.stakeStartTime).div(1 days) % _eventPeriod == 0 ? 0 : 1;
        amountTobeWithdrawn = amountTobeWithdrawn.sub(staker.mode.mul(isLockupTimeOver).mul(amountTobeWithdrawn).mul(_unstakingFeeRate).div(1e4));
        totalStaked = totalStaked.sub(amountTobeWithdrawn);
        staker.stakedAmount = staker.stakedAmount.sub(amountTobeWithdrawn);
        token.safeTransfer(msg.sender, amountTobeWithdrawn);

        emit Withdraw(msg.sender, amountTobeWithdrawn);
    }

    function setFixedAPY(uint256 __fixedAPY) external onlyOwner {

        require(__fixedAPY > 0, "Invalid APY");
        
        _fixedAPY = __fixedAPY;

        emit SetFixedAPY(__fixedAPY);
    }

    function setEventPeriod(uint256 __eventPeriod) external onlyOwner {
        
        require(__eventPeriod > 0, "Invalid Lockup Duration");

        _eventPeriod = __eventPeriod.mul(1 days);

        emit SetEventPeriod(__eventPeriod);
    }

    function setUnstakingFeeRate(uint256 __unstakingFeeRate) external onlyOwner {

        require(__unstakingFeeRate > 0, "Invalid Unstaking Fee Rate");

        _unstakingFeeRate = __unstakingFeeRate;

        emit SetUnstakingFeeRate(__unstakingFeeRate);
    }

    function setBountyWallet(address __bountyWallet) external onlyOwner {
        
        require(__bountyWallet > address(0), "Invalid Address. Address can't be zero");

        _bountyWallet = __bountyWallet;

        emit SetBountyWallet(__bountyWallet);
    }

    // Amount of reward staker can be guaranteed.
    function rewardToHarvest() public view returns (uint256){
        
        // updateReward();
        return _staker[msg.sender].stakerCurrentReward;
    }

    // Get reward of msg.sender
    function harvest() public{
        
        updateReward();
        Staker storage staker = _staker[msg.sender];
        uint256 rewardToClaim = staker.stakerCurrentReward.sub(staker.stakerCurrentReward.mul(_rewardFeeRate).div(10**4));
        
        require(rewardToClaim > 0, "Nothing to claim");
        if (rewardToClaim > token.balanceOf(_bountyWallet))
            rewardToClaim = token.balanceOf(_bountyWallet);
        token.safeTransferFrom(_bountyWallet, msg.sender, rewardToClaim);
        staker.stakerCurrentReward = 0;

        emit Harvest(msg.sender, rewardToClaim);
    }
    
    // Amount of token staked in staking pool.
    function stakedAmount() public view returns (uint256) {
        
        return _staker[msg.sender].stakedAmount;
    }

    function rewardAmount() public view returns (uint256) {
        return _staker[msg.sender].stakerCurrentReward;
    }
}

